@-moz-document domain("worktile.com") {
	html > body{
		-webkit-filter:invert(0) !important;
		-moz-filter:invert(0) !important;
		-ms-filter:invert(0) !important;
		filter:invert(0) !important;
	}
	html img, html embed, html iframe, html object{
		-webkit-filter:invert(0) !important;
		-moz-filter:invert(0) !important;
		-ms-filter:invert(0) !important;
		filter:invert(0) !important;
	}
}
